import React, { useState, useEffect } from 'react';
import { Helmet } from 'react-helmet';
import 'bootstrap/dist/css/bootstrap.min.css';
import videoData from './videos.json';  // Make sure the path is correct based on your project structure

function Home() {
  const [videos, setVideos] = useState([]);

  useEffect(() => {
    setVideos(videoData.videos);  // Set the videos from the JSON data on component mount
  }, []);

  return (
    <div>
      <Helmet>
        <meta charSet="UTF-8" />
        <meta name="keywords" content="soccer stats leagues" />
        <meta name="author" content="Aaron J Park" />
        <meta name="viewport" content="width=device-width, initial-scale=1.0" />
        <title>Hatttrick</title>
        <link
          href="https://cdn.jsdelivr.net/npm/bootstrap@5.3.3/dist/css/bootstrap.min.css"
          rel="stylesheet"
          integrity="sha384-QWTKZyjpPEjISv5WaRU9OFeRpok6YctnYmDr5pNlyT2bRjXh0JMhjY6hW+ALEwIH"
          crossOrigin="anonymous"
        />
        <link rel="stylesheet" href="./styles.css" />
      </Helmet>

      {/* Existing sections can be kept here as is */}

      <section id="hero">
        {/* Hero section content */}
      </section>

      {/* Videos Section */}
      <section id="videos">
        <div className="container">
          <h2 className="text-center my-4">Featured Videos</h2>
          <div className="row">
            {videos.map((videoUrl, index) => (
              <div className="col-md-6 col-lg-4 my-3" key={index}>
                <iframe
                  width="100%"
                  height="315"
                  src={videoUrl}
                  title="YouTube video player"
                  frameBorder="0"
                  allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture"
                  allowFullScreen
                ></iframe>
              </div>
            ))}
          </div>
        </div>
      </section>

      <footer>
        {/* Footer content */}
      </footer>

      <script
        src="https://cdn.jsdelivr.net/npm/bootstrap@5.3.3/dist/js/bootstrap.bundle.min.js"
        integrity="sha384-YvpcrYf0tY3lHB60NNkmXc5s9fDVZLESaAA55NDzOxhy9GkcIdslK1eN7N6jIeHz"
        crossOrigin="anonymous"
      ></script>
    </div>
  );
}

export default Home;
